import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import './App.css';

import { LoginPage } from './components/LoginPage';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>

          <Route path="/login" element={<LoginPage />} />
          <Route path="*" element={() => { return <div>Other pages</div> }} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
